import React from 'react';
import './App.scss';
import Home from './pages/Home';
import NavBar from './components/NavBar';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";

function App() {
    return (
        <div className="App">
            <NavBar></NavBar>
            <Home></Home>
        </div>
    );
}

export default App;
